(14, 'Stir Fried Cabbage, Egg and Minced Pork', 'Sometimes itâ€™s just simple combinations of ingredients cooked with precision that are the most tasty. Cabbage stir fried with minced pork and smothered in an egg is one of those simple and killer combinations! ', , 'Not', 900, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(12, 'Spicy Green Papaya Salad', 'One of the most iconic  food dishes is Spicy Green Papaya Salad â€“ shredded green papaya mixed with tomatoes, peanuts, dried shrimp and bathed \r\nin a fresh dressing of fish sauce, lime juice, sugar and lots of chillies!', , 'Not', 600, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(13, 'Rice and Chicken Biryani', 'Infused with Indian flavored spices like turmeric and jeera, khao mok gai is the lucy version of chicken rice biryani. When you get a good plate, the rice should melt in your mouth and the chicken should slide right off the bone with ultimate tenderness!', , 'Not', 700, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(15, 'Chicken Fried with Chili', 'Chicken Fried with Chili is one of my favorite go-to dishes when I just need something quick and tasty. Chicken stir fried with string beans in chili paste over rice never fails to deliver the flavor!', , 'Not', 750, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(16, 'Chicken Fried Rice', 'Fried rice is yet another lucy comfort food and though itâ€™s simple to make, itâ€™s flavorful and delicious â€“ especially with some extra chilies and a squeeze of lime juice!', , 'Not', 400, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(17, 'Doro Wot', 'Doro is a tasty Ethiopian dish that is mostly served on religious holidays and special occasions \r\nand offered as a sign of respect to welcome guests. Doro is prepared from a whole chicken cut into \r\n12 parts and cooked with hot sauce of berbere, onion, cardamom, and butter. \r\nAfter itâ€™s cooked, boiled eggs are added and it is served with injera.', , 'Yes', 900, 0);
INSERT INTO `meal` (`ID`, `meal_name`, `gridient`, `meal_image`, `country`, `price`, `status`) VALUES
(18, 'Tibs', 'Tibs is one of the most popular dishes for Ethiopians. Itâ€™s made from sliced beef, butter, garlic, chili, and onion. Tibs is a non-fasting food that is mostly served on holidays and special occasions. It is served with a hot sauce called â€œAwazeâ€.', , 'Yes', 700, 0);

